	// which is selected is being used as the condition for create or update
	// if not, the unique Id is being used
	cond2 := &WebPushConfigEntity{UserId: NewString(query.UserId)}
	q := dbref.
		Where(cond2).
		FirstOrCreate(&item)
	err := q.UpdateColumns(fields).Error
	if err != nil {
		return nil, GormErrorToIError(err)
	}
	query.Tx = dbref
	WebPushConfigRelationContentUpdate(fields, query)
	WebPushConfigPolyglotUpdateHandler(fields, query)
	if ero := WebPushConfigDeleteEntireChildren(query, fields); ero != nil {
		return nil, ero
	}
	// @meta(update has many)
	err = dbref.
		Preload(clause.Associations).
		Where(&WebPushConfigEntity{UniqueId: uniqueId}).
		First(&itemRefetched).Error
	if err != nil {
		return nil, GormErrorToIError(err)
	}
	actionEvent, eventErr := NewWebPushConfigUpdatedEvent(fields, &query)
	if actionEvent != nil && eventErr == nil {
		GetEventBusInstance().FireEvent(query, *actionEvent)
	} else {
		log.Default().Panicln("Updating event has failed for %v", fields)
	}
